(function(){angular.module("bookingSystem.customerServices",["ngResource"]).factory("Customer",["$resource","API_URL",function($resource,API_URL){return $resource(API_URL+"Customer/:customerId",{customerId:"@customerId"},{querySearch:{url:API_URL+"Customer/search/:column",id:"@id",method:"GET",isArray:true,params:{column:"@column"}}})}]).factory("CustomerImage",["$http","API_URL",function($http,API_URL){return{upload:function(imageData,customerId){return $http({method:"POST",url:API_URL+"Customer/image/"+customerId,data:imageData,headers:{"Content-Type":undefined}})}}}])})();